import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
  const [activeTab, setActiveTab] = useState('home');

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  return (
    <div className="container mt-4">
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <div className="container-fluid">
          <Link to="/" className="navbar-brand animate-character">Pharmacy App</Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
            aria-controls="navbarNav"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className={`nav-item ${activeTab === 'home' ? 'active' : ''}`}>
                <Link className="nav-link" to="/" onClick={() => handleTabClick('home')}>Home</Link>
              </li>
              <li className={`nav-item ${activeTab === 'city' ? 'active' : ''}`}>
                <Link className="nav-link" to="/city" onClick={() => handleTabClick('city')}>City</Link>
              </li>
              <li className={`nav-item ${activeTab === 'zone' ? 'active' : ''}`}>
                <Link className="nav-link" to="/zone" onClick={() => handleTabClick('zone')}>Zone</Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <div className="mt-4">
        <h1>{activeTab === 'home' ? 'Home Page' : activeTab.charAt(0).toUpperCase() + activeTab.slice(1)}</h1>
        {/* Render different components based on the activeTab value */}
        {/* For example, render <City /> component when activeTab is 'city' */}
        {/* Render other components similarly */}
      </div>
    </div>
  );
};

export default Home;
